package com.ArrayList;

import java.util.HashSet;

public class HashSetDemo5 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<Integer> hs = new HashSet<Integer>();
		hs.add(10);
		hs.add(20);
		hs.add(49);
		hs.add(69);
		for(int i:hs) {
			System.out.println(i);
		}

	}

}
